import {StyleSheet} from 'react-native';

export default StyleSheet.create({
  accountMenuItemContainer: {
    marginTop: 10,
  },
  profileAvatar: {
    width: 60,
    height: 60,
  },
  buttonContainer: {
    padding: 10,
  },
});
